package com.entity.human1;

public class classOperator1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=29;
		System.out.println("Decrement operator(Increment then Print"+a+"): "+ --a);
		System.out.println("Increment operator(Print then increment"+a+"): "+ a++);
		System.out.println("Increment operator(Increment then Print "+b+"): "+ ++b);
		System.out.println("Decrement operator(Print then increment"+b+"): "+ b++);
		
	}

}
